# 3.2 Low-rank approximation and Many-body approximation 

When summing the tensors in Equations (1) over indices $\boldsymbol{r}$, these models are identical to the traditional low-rank models, CP, Tucker, and TT formats, respectively.

$$
\mathcal{P}_{\boldsymbol{i}}^{\mathrm{CP}}=\sum_{r} \mathcal{Q}_{\boldsymbol{i} r}^{\mathrm{CP}}, \quad \mathcal{P}_{\boldsymbol{i}}^{\text {Tucker }}=\sum_{r_{1} \ldots r_{D}} \mathcal{Q}_{\boldsymbol{i} r_{1} \ldots r_{D}}^{\text {Tucker }}, \quad \mathcal{P}_{\boldsymbol{i}}^{\mathrm{TT}}=\sum_{r_{1} \ldots r_{D-1}} \mathcal{Q}_{\boldsymbol{i} r_{1} \ldots r_{D-1}}^{\mathrm{TT}}
$$

We recall here that $\mathcal{Q}^{k}$ is a nonnegative normalized tensor, and we regard the sum $\sum_{k}$ in Equation (6) as a marginalization of the distribution $\mathcal{Q}^{k}$ over the random variables $\boldsymbol{r}$. We therefore interpret the low-rank structure $\mathcal{P}^{k}$ as a model with visible variables $\boldsymbol{i}$ and hidden variables $\boldsymbol{r}$. We remark that it is standard usage in the machine learning community to refer to a marginalized random variable as a hidden variable [24, 26].
The degree of freedom of hidden variables $\left(R_{1}, \ldots, R_{V}\right)$ corresponds to $C P$ rank, Tucker rank, and $T T$ rank with $V=1$ for $\mathcal{Q}^{\mathrm{CP}}, V=D$ for $\mathcal{Q}^{\text {Tucker }}$, and $V=D-1$ for $\mathcal{Q}^{\mathrm{TT}}$, respectively. Since any low-rank structure is defined by summing over its ranks, any low-rank approximation can be regarded as a many-body approximation with hidden variables. When a low-rank tensor $\mathcal{P}$ is obtained by marginalization of a tensor $\mathcal{Q}$ with appropriately selected modes, we refer to tensor $\mathcal{Q}$ as the low-body tensor corresponding to $\mathcal{P}$. For example, $\mathcal{Q}^{\mathrm{CP}}, \mathcal{Q}^{\text {Tucker }}$ and $\mathcal{Q}^{\mathrm{TT}}$ are low-body tensors corresponding to a low-rank tensor $\mathcal{P}^{\mathrm{CP}}, \mathcal{P}^{\text {Tucker }}$, and $\mathcal{P}^{\mathrm{TT}}$, respectively. In the following, hidden variables - corresponding to modes summed according to the low-rank structure - are denoted by $\boldsymbol{r}$ and visible variables - variables other than hidden variables - by $\boldsymbol{i}$.
The many-body approximation involves only visible variables in the model, making maximum likelihood estimation a convex optimization problem, while the low-rank approximation requires a non-convex optimization due to the hidden variables in the model. Therefore, although finding an exact solution for the low-rank approximation is challenging, the optimization remains tractable through the EM algorithm [12], a well-known general framework for maximum likelihood estimation that accommodates hidden variables.
Whereas it is already known that many-body approximation coincides with the non-negative tensor network using Dirac tensors on the nodes [19], it is our contribution to clarify the relationship between general low-rank approximation and many-body approximation.

Input: Non-negative tensor $\mathcal{T}$, the number of mixtures $K$, and ranks $\left(R^{1}, \ldots, R^{K}\right)$;
Initialize $\mathcal{Q}^{k}$ and $\eta^{k}$ for all $k \in[K]$;
repeat
$\mathcal{P}_{i} \leftarrow \sum_{k} \eta^{k} \mathcal{P}_{i}^{k}$ where $\mathcal{P}_{i}^{k}=\sum_{r \in R^{k}} \mathcal{Q}_{i r}^{k}$;
$\mathcal{M}_{i r}^{k} \leftarrow \mathcal{T}_{i} \mathcal{Q}_{i r}^{k} / \mathcal{P}_{i}$ for all $k \in[K]$;
Update $\mathcal{Q}^{k}$ for all $k \in[K]$ by Eqs (1) and (3)-(5);
Update $\eta^{k}$ by Eq. (12) for all $k \in[K]$;
until Convergence

# C. 2 EM tensor factorization for general non-negative tensors 

Non-negative tensor factorization optimizing the KL divergence is frequently used beyond density estimation and in various fields such as sound source separation [35], computer vision [31, 49], and data mining [9, 57, 33, 15]. Although the given tensor $\mathcal{T}$ is not necessarily normalized in such applications, the proposed framework can be used for them as follows. First, we obtain the total sum of the input tensor $\mu=\sum_{t} \mathcal{T}_{t}$ and then perform the factorization on the normalized tensor $\mathcal{T}$ by dividing all elements of $\mathcal{T}$ by $\mu$. Finally, all elements of the resulting tensor $\mathcal{P}$ are multiplied by $\mu$. This procedure is justified by the property of the KL divergence, $D_{K L}(\mu \mathcal{P}, \mu \mathcal{T})=\mu D_{K L}(\mathcal{P}, \mathcal{T})$, where $\mu$ is any positive value.

```
\(\operatorname{Intr}_{\text {main }}:\) Non-negative tensor \(\mathcal{T}\) and train rank \(R^{\text {Train }}=\left(R_{1}, \ldots, R_{D-1}\right)\).
    Initialize \(\mathcal{Q}^{\text {Train }}\);
    repeat
        for \(d=1\) to \(D\) do
            Obtain \(\mathcal{G}^{(\rightarrow d)}\) and \(\mathcal{G}^{(D-d \leftarrow)}\) using Equation (13);
        end for
        Update \(\mathcal{G}^{(1)}, \ldots, \mathcal{G}^{(D)}\) using Equation (14);
        \(\mathcal{P}_{i}^{\text {Train }} \leftarrow \mathcal{G}_{i}^{(\rightarrow D)}\) for \(\boldsymbol{i} \in \Omega_{I}^{G}\);
    until Convergence
```
